import React from "react";


import styles from './Account.module.css';

const Account = (props) =>{

    props.getPage('manage-accounts');

    useEffect(() => {
        let ac = document.getElementById(page.pageId);
        setMenuActive(ac);
 },[page.pageId])

 const setMenuActive = (menu) => {
     if(menu.id === null){
        console.log("null");
     }else if ( menu.id === 'manage-products') {
        menu.classList.add(`${styles.active}`);
    }else if(menu.id === 'manage-inventory'){
        menu.classList.add(`${styles.active}`);
    }
    else if(menu.id === 'manage-payments'){
        menu.classList.add(`${styles.active}`);
    }
    else if(menu.id === 'manage-accounts'){
        menu.classList.add(`${styles.active}`);
    }
 }


    return(
        <div className={`${styles.container}`}>
            Account
        </div>
    )
}

export default Account;
